import React from 'react';
import {Route, Link } from 'react-router-dom';

import './App.css';
import Home from '../pages/home';


class App extends React.Component {

  constructor(props) {
    super(props);
  }

  render(){
    return (
      <Route path='/' exact render={() => <Home />} />
    );
  }
}

export default App;
